import React from 'react';
import {
  Typography, Divider, Button, TextField, TableContainer
} from '@material-ui/core';

interface UserColumn {
    id: 'RPE' | 'Telefone 1' | 'Telefone 2' | 'E-mail 1' | 'E-mail 2' | 'Companhia' | 'Sigla';
    label: string;
    minWidth?: number;
    align?: 'right';
    format?: (value: number) => string;
  }

class List extends React.Component {

    constructor(props:any) {
        super(props);
        this.state = { inputs: [] };
    }

    handleSubmit(){
        alert('hi!');
    }

    render() {
        return (
            <React.Fragment>
                <Typography variant="h4">Usuários</Typography>

                <Divider/>

                <form className="class" autoComplete="off" onSubmit={this.handleSubmit}>
                    <div>
                        <TextField id="rpe" label="RPE" />
                    </div>
                    <div>
                        <TextField id="email" label="E-mail"/>
                    </div>
                    <div>
                        <TextField id="phone" label="Telefone"/>
                    </div>
                    <div>
                        <TextField id="airline" label="CIA Aérea" />
                    </div>
                    <div>
                        <TextField id="initials" label="Sigla ICIA" />
                    </div>
                    <div>
                        <Button type="submit">Pesquisar</Button>
                    </div>
                </form>

                <Divider/>



            </React.Fragment>
        );
    }
}

export default List;
